import React from "react";
import { useSpring, animated } from "react-spring";
import stock from '../img/stock.JPEG';
import ImageContainer from './ImageContainer';

export const Features = (props) => {

const config = [
    {
        imgSrc:stock,
        stylingId:"smn",
        title:"Stock Market Navigator",
        bodyContent:"Stay ahead of the curve with our cutting-edge platform that delivers real-time stock market data at your fingertips. Make informed decisions, track trends, and secure your financial future with ease",
    },
    {
        imgSrc:stock,
        stylingId:"about",
        title:"Stock Market Navigator",
        bodyContent:"Stay ahead of the curve with our cutting-edge platform that delivers real-time stock market data at your fingertips. Make informed decisions, track trends, and secure your financial future with ease",
    },
    {
        imgSrc:stock,
        stylingId:"smn",
        title:"Stock Market Navigator",
        bodyContent:"Stay ahead of the curve with our cutting-edge platform that delivers real-time stock market data at your fingertips. Make informed decisions, track trends, and secure your financial future with ease",
    },
]
  return config?.map((item, index) => <ImageContainer
                                            index={index}
                                            imgSrc={item?.imgSrc}
                                            title={item?.title}
                                            bodyContent={item?.bodyContent}
                                            stylingId={item.stylingId}/>
                                          );
                                        };
